import React from 'react';
import { useDispatch,useSelector} from 'react-redux';
import { loadPostStart } from './actions';


const Test = ()=>{

    const storeapi = useSelector((state)=>state.apiCallReducers.posts)
const dispatch = useDispatch;




    return(
        <>
        <hr/>
            <h1>Test api</h1>
            <button onClick = {()=>dispatch(loadPostStart())}>Fetch</button>
            <div>
                {
                    storeapi.map((ele,ind)=>{
                        return(
                        <h1>{ele.Title}</h1>
                        );
                    })
                }
            </div>

        </>
    );
}

export default Test;
